import '@babel/polyfill';
import { login, logout, signup } from './account';
import { addTodo, deleteTodo } from './todos';
import { showAlert } from './showAlert';
const loginForm = document.querySelector('.form--login');
const logoutButton = document.getElementById('logout');
const signupForm = document.querySelector('.form--signup');
const ltForm = document.querySelector('.form--lt');
const deleteButton = document.querySelectorAll('.tl__btn--delete');
if (loginForm) {
    loginForm.addEventListener('submit', e => {
        e.preventDefault();
        const name = document.getElementById('username').value;
        const password = document.getElementById('password').value;
        login(name, password);
    });
}
if (logoutButton) {
    logoutButton.addEventListener('click', e => {
        e.preventDefault();
        logout();
    });
}
if (signupForm) {
    signupForm.addEventListener('submit', e => {
        e.preventDefault();
        const name = document.getElementById('username').value;
        const password = document.getElementById('password').value;
        const passwordConfirm = document.getElementById('passwordConfirm').value;
        const email = document.getElementById('email').value;
        signup(name, password, passwordConfirm, email);
    });
}
if (ltForm) {
    ltForm.addEventListener('submit', e => {
        e.preventDefault();
        const name = document.getElementById('name').value;
        const description = document.getElementById('description').value;
        const time = document.getElementById('time').value;

        addTodo(name, description, time);


    });
}
if (deleteButton) {
    deleteButton.forEach(el => {
        el.addEventListener('click', e => {
            e.preventDefault();
            deleteTodo(e.target.parentElement.parentElement.id);
        });
    });


}
